INSERT INTO `survey_questions` (`id`, `survey`, `name`, `question`) VALUES
(967, 69, 'Issue', 'What are the THREE MOST pressing problems facing Nairobi County?\r\n1. Corruption\r\n2. Food insecurity\r\n3. High cost of living\r\n4. Poor health care\r\n5. Poor quality education\r\n6. Poor roads\r\n7. Security: Increased crime\r\n8. Unemployment/Lack of job opportunities\r\n9. Water shortage\r\n10. Any Other (Type in)\r\n'),
(969, 69, 'Governor ', 'Who are you likely to vote for as the Governor for Nairobi County in the next general elections? \r\n1. Ann Kagure\r\n2. Ann Kananu\r\n3. Dennis Waweru\r\n4. Johnson Sakaja\r\n5. Margaret Wanjiru\r\n6. Richard Ngatia\r\n7. Tim Wanyonyi\r\n8. Undecided\r\n9. Won&#039;t Vote\r\n10. Other [Type name]'),
(970, 69, 'Senator', 'Who are you likely to vote for as the Senator for Nairobi County in the next general elections? \r\n1. Edwin Sifuna\r\n2. Karen Nyamu\r\n3. Maina Kamanda\r\n4. Maurice Ibale\r\n5. Milton Lucheri\r\n6. Sande Omwami Oyalo\r\n7. Suzanne Silantoi Lengewa\r\n8. Undecided\r\n9. Won&#039;t Vote\r\n10. Others [Type]'),
(971, 69, 'Womanrep', 'Who are you likely to vote for as the Woman Representative for Nairobi County in the next general elections? \r\n1.	Beatrice Kwamboka\r\n2.	Elizabeth Ongoro\r\n3.	Esther Passaris\r\n4.	Millicent Omanga\r\n5.	Rachel Shebesh\r\n6.	Undecided\r\n7.	Won&#039;t Vote\r\n8.	Others [Type]'),
(972, 69, 'President', 'If the Presidential election was to be held today, who would you vote for as the President? \r\n1.	Gideon Moi\r\n2.	Kalonzo Musyoka\r\n3.	Martha Karua\r\n4.	Musalia Mudavadi\r\n5.	Mwangi Wa Iria\r\n6.	Raila Odinga\r\n7.	William Ruto\r\n8.	Undecided\r\n9.	Won&#039;t Vote\r\n10.	Others [Type]'),
(973, 69, 'Party', 'Which political party or alliance do you feel closest to?  \r\n1.	ANC\r\n2.	Azimio la Umoja\r\n3.	Ford Kenya\r\n4.	Jubilee Party\r\n5.	KANU\r\n6.	Kenya Kwanza\r\n7.	NARC KENYA\r\n8.	ODM\r\n9.	One Kenya Alliance (OKA)\r\n10.	UDA\r\n11.	WIPER\r\n12.	Undecided\r\n13.	Won&#039;t Vote\r\n14.	Others [Type]'),
(975, 69, 'Thank you', 'Thank you for taking part in this survey.'),
(976, 70, 'Issues', 'What are the THREE MOST pressing problems facing Mombasa County?\r\n1. Corruption\r\n2. Food insecurity\r\n3. High cost of living\r\n4. Poor health care\r\n5. Poor quality education\r\n6. Poor roads\r\n7. Security: Increased crime\r\n8. Unemployment/Lack of job opportunities\r\n9. Water shortage\r\n10. Any Other (Type in)\r\n'),
(977, 70, 'Governor ', 'Who are you likely to vote for as the Governor for Mombasa County in the next general elections?\r\n1. Abdulswamad Shariff Nassir\r\n2. Hassan Omar\r\n3. Suleiman Shahbal\r\n4. Undecided\r\n5. Won\'t Vote\r\n6. Others [Type]'),
(978, 70, 'Senator', 'Who are you likely to vote for as the Senator for Mombasa County in the next general elections? \r\n1. Abdulsalam Kassim\r\n2. Hamisi Mwaguya\r\n3. Hazel Katana\r\n4. Mohamed Faki\r\n5. William Kingi\r\n6. Undecided\r\n7. Won\'t Vote\r\n8. Others [Type]'),
(979, 70, 'Womanrep', 'Who are you likely to vote for as the Women Representative for Mombasa County in the next general elections? \r\n1. Asha Hussein\r\n2. Josephine Ndinda\r\n3. Undecided\r\n4. Won\'t Vote\r\n5. Others [Type]'),
(980, 70, 'President', 'If the Presidential election was to be held today, who would you vote for as the President? \r\n1. Raila Odinga\r\n2. William Ruto\r\n3. Mwangi Wa Iria\r\n4. Kalonzo Musyoka\r\n5. Musalia Mudavadi\r\n6. Gideon Moi\r\n7. Undecided\r\n8.Won&#039;t Vote\r\n9. Others [Type]'),
(981, 70, 'Party', 'Which political party or alliance do you feel closest to?  \r\n1. ANC\r\n2. Azimio la Umoja\r\n3. Ford Kenya\r\n4. Jubilee Party\r\n5. KANU\r\n6. Kenya Kwanza\r\n7. NARC KENYA\r\n8. ODM\r\n9. One Kenya Alliance (OKA)\r\n10. UDA\r\n11. WIPER\r\n12. Undecided\r\n13. Won&#039;t Vote\r\n14. Others [Type]'),
(982, 70, 'Direction', 'According to you, do you think Mombasa County is heading in the right or wrong direction?\r\n1. Right Direction\r\n2. Wrong Direction\r\n3. No opinion'),
